description:
The EMD SD40-2 for Train Simulator is available in unique Union Pacific red, white and blue livery and features dynamic braking, working step lights, cab lighting and Union Pacific freight cars. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the EMD SD40-2 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Sherman Hill route (available separately and required to play these scenarios).



